import styled from "styled-components";

export const FooterDiv = styled.div`
  display: flex;
  flex-wrap: wrap;
  background-color: #03233e;
  height: 326px;
`;

export const FooterElement = styled.div`
  display: flex;
  flex-direction: column;
  color: white;

`;
